import React, {useState, useEffect} from "react";
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Switch} from "react-router-dom"
import Home from './components/Pages/Home';
import Crib from "./components/Pages/Cribs";
import SingleCrib from "./components/Pages/SingleCrib"
import About from "./components/Pages/About"




function App() {

  const [cribs, setCribs]= useState([])

  // useEffect(() =>{
  //   fetch("http://localhost:3000/cribs")
  //   .then((response) =>response.json())
  //   .then(data =>setCribs(data))
  // }, [])

  useEffect(() => {
    fetch("https://mashvisor-api.p.rapidapi.com/rental-rates?state=CA&source=traditional&city=Los%20Angeles", {
        "method": "GET",
        "headers": {
            "x-rapidapi-host": "mashvisor-api.p.rapidapi.com",
            "x-rapidapi-key": "58536a0d2bmsh2fabd976c3d05fdp1b7371jsncfa30ba7f0de"
        }
    })
    .then(response => response.json())
    .then(data => setCribs(data))
    }, [])


  return (
  <>
  <Router>
    <Navbar />
    <Switch>

      {/* <Route path='/'> <Redirect to="/home" /> </Route>  */}
      <Route path='/about'><About/></Route>
      <Route path='/cribs'><Crib cribs={cribs}/></Route>
      <Route path='/' exact><Home /> </Route>
      <Route path="/crib/:id"><SingleCrib cribs={cribs}/></Route>

      </Switch>
     </Router>
    </>
  );
}

export default App;

